INSERT INTO BBS (ID, TITLE, POST_TEXT, REG_USER, MOD_USER, REG_DATE, MOD_DATE) VALUES ('5', '수봉공원', '1990년대 말까지 인천의 놀이공원 수요를 감당했던 곳이다. 주소는 인천광역시 미추홀구 수봉안길 84 이며, 수봉산 또는 수봉공원이라고 불린다. 현재는 나름 벚꽃 명소로 활용되는 듯하다.', 'system', 'system', NOW(), NOW());
