INSERT INTO BBS (ID, TITLE, POST_TEXT, REG_USER, MOD_USER, REG_DATE, MOD_DATE) VALUES ('10', '건륭제', '청나라(淸)의 제6대 황제. 옹정제의 4남으로 할아버지 강희제, 아버지 옹정제의 뒤를 이어 흔히 강건성세로 알려진 청나라의 전성기를 이끌었던 황제이며 그의 치세 동안 청나라의 경제, 군사, 문화는 절정을 맞이했다. ', 'system', 'system', NOW(), NOW());
