INSERT INTO BBS (ID, TITLE, POST_TEXT, REG_USER, MOD_USER, REG_DATE, MOD_DATE) VALUES ('17','A310','에어버스에서 개발한 중, 단거리용 광동체 여객기. A300를 단축하여 항속거리를 늘린 파생형으로, 1982년 4월에 초도 비행을 하였고, 이듬해인 1983년 4월에 상업운항을 시작하여 1998년에 단종되었다. 총 255대가 생산되어 2022년 8월 현재 30대(11.8%)가 운용되고 있으며, 민간에서는 총 22대가 운용되고 있다.','system', 'system', NOW(), NOW());
