INSERT INTO BBS (ID, TITLE, POST_TEXT, REG_USER, MOD_USER, REG_DATE, MOD_DATE) VALUES ('19','뉴욕 메츠/2020년','브랜든 니모의 1타점 2루타가 전부였고, 투수진은 릭 포셀로부터 코리 오스왈트, 폴 시월드까지 나오는 투수마다 다 털렸다. 그나마 헌터 스트릭랜드가 전 경기와 다르게 무실점을 기록했다.','system', 'system', NOW(), NOW());
