INSERT INTO BBS (ID, TITLE, POST_TEXT, REG_USER, MOD_USER, REG_DATE, MOD_DATE) VALUES ('24','오베라는 남자','스웨덴의 작가 프레드릭 배크만의 장편 소설. 한국에는 다산책방 출판사를 통해 2015년 5월 20일에 발매되었다. 2016년 5월 25일에 영화화되어 한국에 개봉되었다.','system', 'system', NOW(), NOW());
