INSERT INTO BBS (ID, TITLE, POST_TEXT, REG_USER, MOD_USER, REG_DATE, MOD_DATE) VALUES ('27','사마엘','유대교 전설에 나오는 천사. 탈무드에 언급된, 죽음을 관장하는 천사다. 12장의 날개를 가진 최고위 천사였으며, 사탄과 동일시되기도 한다.','system', 'system', NOW(), NOW());
INSERT INTO BBS (ID, TITLE, POST_TEXT, REG_USER, MOD_USER, REG_DATE, MOD_DATE) VALUES ('28', '매튜 델라베도바', '오스트레일리아의 농구 선수이자, 현 새크라멘토 킹스 소속 가드. 석도바라는 별명이 붙을 정도로 한국 NBA팬들에게 깊은 인상을 남긴 선수이다. 포지션 대비 신장은 리그 평균급에 운동신경이 뛰어나다고 할수 없을 정도이지만 특유의 허슬과 악착같고 더티한 가로수비, 풋볼 선수 출신다운 몸사리지 않은 다이빙 등을 바탕으로 리그에서 살아남은 선수이다.', 'system', 'system', NOW(), NOW());
