INSERT INTO BBS (ID, TITLE, POST_TEXT, REG_USER, MOD_USER, REG_DATE, MOD_DATE) VALUES ('31', '조지 허버트', '영국의 백작. 하워드 카터를 후원해 투탕카멘의 무덤을 발굴한 걸로 유명하다. 풀네임은 조지 에드워드 스탠호프 몰리뉴 허버트(George Edward Stanhope Molyneux Herbert). 카나본 경 혹은 카나본 백작이라는 작위로 훨씬 더 잘 알려져 있다.', 'system', 'system', NOW(), NOW());